INSERT INTO `tbl_page` (`id`, `title`, `status`, `description`) VALUES
(1, 'Privacy Policy', 1, '<p>Privacy Policy</p><p>This privacy policy applies to the GoMeet - Complete Social Dating Mobile App | Online Dating | Match, Chat &amp; Video Dating | Dating App app (hereby referred to as \"Application\") for mobile devices that was created by CSCODETECH (hereby referred to as \"Service Provider\") as a Free service. This service is intended for use \"AS IS\".</p><p><br></p><p><br></p><p>Information Collection and Use</p><p>The Application collects information when you download and use it. This information may include information such as</p><p><br></p><p>Your device\'s Internet Protocol address (e.g. IP address)</p><p>The pages of the Application that you visit, the time and date of your visit, the time spent on those pages</p><p>The time spent on the Application</p><p>The operating system you use on your mobile device</p><p><br></p><p>The Application does not gather precise information about the location of your mobile device.</p><p><br></p><p><br></p><p>The Service Provider may use the information you provided to contact you from time to time to provide you with important information, required notices and marketing promotions.</p><p><br></p><p><br></p><p>For a better experience, while using the Application, the Service Provider may require you to provide us with certain personally identifiable information, including but not limited to Email. The information that the Service Provider request will be retained by them and used as described in this privacy policy.</p><p><br></p><p><br></p><p>Third Party Access</p><p>Only aggregated, anonymized data is periodically transmitted to external services to aid the Service Provider in improving the Application and their service. The Service Provider may share your information with third parties in the ways that are described in this privacy statement.</p><p><br></p><p><br></p><p>Please note that the Application utilizes third-party services that have their own Privacy Policy about handling data. Below are the links to the Privacy Policy of the third-party service providers used by the Application:</p><p><br></p><p>Google Play Services</p><p><br></p><p>The Service Provider may disclose User Provided and Automatically Collected Information:</p><p><br></p><p>as required by law, such as to comply with a subpoena, or similar legal process;</p><p>when they believe in good faith that disclosure is necessary to protect their rights, protect your safety or the safety of others, investigate fraud, or respond to a government request;</p><p>with their trusted services providers who work on their behalf, do not have an independent use of the information we disclose to them, and have agreed to adhere to the rules set forth in this privacy statement.</p><p><br></p><p>Opt-Out Rights</p><p>You can stop all collection of information by the Application easily by uninstalling it. You may use the standard uninstall processes as may be available as part of your mobile device or via the mobile application marketplace or network.</p><p><br></p><p><br></p><p>Data Retention Policy</p><p>The Service Provider will retain User Provided data for as long as you use the Application and for a reasonable time thereafter. If you\'d like them to delete User Provided Data that you have provided via the Application, please contact them at support@cscodetech.com and they will respond in a reasonable time.</p><p><br></p><p><br></p><p>Children</p><p>The Service Provider does not use the Application to knowingly solicit data from or market to children under the age of 13.</p><p><br></p><p><br></p><p>The Application does not address anyone under the age of 13. The Service Provider does not knowingly collect personally identifiable information from children under 13 years of age. In the case the Service Provider discover that a child under 13 has provided personal information, the Service Provider will immediately delete this from their servers. If you are a parent or guardian and you are aware that your child has provided us with personal information, please contact the Service Provider (support@cscodetech.com) so that they will be able to take the necessary actions.</p><p><br></p><p><br></p><p>Security</p><p>The Service Provider is concerned about safeguarding the confidentiality of your information. The Service Provider provides physical, electronic, and procedural safeguards to protect information the Service Provider processes and maintains.</p><p><br></p><p><br></p><p>Changes</p><p>This Privacy Policy may be updated from time to time for any reason. The Service Provider will notify you of any changes to the Privacy Policy by updating this page with the new Privacy Policy. You are advised to consult this Privacy Policy regularly for any changes, as continued use is deemed approval of all changes.</p><p><br></p><p><br></p><p>This privacy policy is effective as of 2024-04-29</p><p><br></p><p><br></p><p>Your Consent</p><p>By using the Application, you are consenting to the processing of your information as set forth in this Privacy Policy now and as amended by us.</p><p><br></p><p><br></p><p>Contact Us</p><p>If you have any questions regarding privacy while using the Application, or have questions about the practices, please contact the Service Provider via email at support@cscodetech.com.</p>'),
(2, 'Terms & Conditions', 1, '<p>Terms &amp; Conditions</p><p>These terms and conditions applies to the GoMeet - Complete Social Dating Mobile App | Online Dating | Match, Chat &amp; Video Dating | Dating App app (hereby referred to as \"Application\") for mobile devices that was created by CSCODETECH (hereby referred to as \"Service Provider\") as a Free service.</p><p><br></p><p><br></p><p>Upon downloading or utilizing the Application, you are automatically agreeing to the following terms. It is strongly advised that you thoroughly read and understand these terms prior to using the Application. Unauthorized copying, modification of the Application, any part of the Application, or our trademarks is strictly prohibited. Any attempts to extract the source code of the Application, translate the Application into other languages, or create derivative versions are not permitted. All trademarks, copyrights, database rights, and other intellectual property rights related to the Application remain the property of the Service Provider.</p><p><br></p><p><br></p><p>The Service Provider is dedicated to ensuring that the Application is as beneficial and efficient as possible. As such, they reserve the right to modify the Application or charge for their services at any time and for any reason. The Service Provider assures you that any charges for the Application or its services will be clearly communicated to you.</p><p><br></p><p><br></p><p>The Application stores and processes personal data that you have provided to the Service Provider in order to provide the Service. It is your responsibility to maintain the security of your phone and access to the Application. The Service Provider strongly advise against jailbreaking or rooting your phone, which involves removing software restrictions and limitations imposed by the official operating system of your device. Such actions could expose your phone to malware, viruses, malicious programs, compromise your phone\'s security features, and may result in the Application not functioning correctly or at all.</p><p><br></p><p>Please note that the Application utilizes third-party services that have their own Terms and Conditions. Below are the links to the Terms and Conditions of the third-party service providers used by the Application:</p><p><br></p><p>Google Play Services</p><p><br></p><p>Please be aware that the Service Provider does not assume responsibility for certain aspects. Some functions of the Application require an active internet connection, which can be Wi-Fi or provided by your mobile network provider. The Service Provider cannot be held responsible if the Application does not function at full capacity due to lack of access to Wi-Fi or if you have exhausted your data allowance.</p><p><br></p><p><br></p><p>If you are using the application outside of a Wi-Fi area, please be aware that your mobile network provider\'s agreement terms still apply. Consequently, you may incur charges from your mobile provider for data usage during the connection to the application, or other third-party charges. By using the application, you accept responsibility for any such charges, including roaming data charges if you use the application outside of your home territory (i.e., region or country) without disabling data roaming. If you are not the bill payer for the device on which you are using the application, they assume that you have obtained permission from the bill payer.</p><p><br></p><p><br></p><p>Similarly, the Service Provider cannot always assume responsibility for your usage of the application. For instance, it is your responsibility to ensure that your device remains charged. If your device runs out of battery and you are unable to access the Service, the Service Provider cannot be held responsible.</p><p><br></p><p><br></p><p>In terms of the Service Provider\'s responsibility for your use of the application, it is important to note that while they strive to ensure that it is updated and accurate at all times, they do rely on third parties to provide information to them so that they can make it available to you. The Service Provider accepts no liability for any loss, direct or indirect, that you experience as a result of relying entirely on this functionality of the application.</p><p><br></p><p><br></p><p>The Service Provider may wish to update the application at some point. The application is currently available as per the requirements for the operating system (and for any additional systems they decide to extend the availability of the application to) may change, and you will need to download the updates if you want to continue using the application. The Service Provider does not guarantee that it will always update the application so that it is relevant to you and/or compatible with the particular operating system version installed on your device. However, you agree to always accept updates to the application when offered to you. The Service Provider may also wish to cease providing the application and may terminate its use at any time without providing termination notice to you. Unless they inform you otherwise, upon any termination, (a) the rights and licenses granted to you in these terms will end; (b) you must cease using the application, and (if necessary) delete it from your device.</p><p><br></p><p><br></p><p>Changes to These Terms and Conditions</p><p>The Service Provider may periodically update their Terms and Conditions. Therefore, you are advised to review this page regularly for any changes. The Service Provider will notify you of any changes by posting the new Terms and Conditions on this page.</p><p><br></p><p><br></p><p>These terms and conditions are effective as of 2024-04-29</p><p><br></p><p><br></p><p>Contact Us</p><p>If you have any questions or suggestions about the Terms and Conditions, please do not hesitate to contact the Service Provider at support@cscodetech.com.</p>'),
(3, 'Contact Us', 1, '<p>We’ll start with some questions and get you to the right place.</p><p><br></p><p>let’s get you some help. We’re going to ask you some questions and then connect you with a member of our support team.</p><p><br></p><p>Can you describe your issue in a few sentences? This will help our team understand what’s going on.</p><p><br></p><p>Skype: CSCODETECH</p><p><br></p><p>Facebook: CSCODETECH</p><p><br></p><p>WhatsApp: +91 7276465975</p>'),
(4, 'Safety & Policy', 1, '<p>Dating Safety Tips</p><p>Meeting new people is exciting, but you should always be cautious when interacting with someone you don’t know. Use your best judgment and put your safety first, whether you are exchanging initial messages or meeting in person. While you can’t control the actions of others, there are things you can do to help you stay safe during your GoMeet experience.</p><p><br></p><p>Online Safety</p><p>Never Send Money or Share Financial Information</p><p><br></p><p>Never send money, especially over wire transfer, even if the person claims to be in an emergency. Wiring money is like sending cash — it’s nearly impossible to reverse the transaction or trace where the money went. Never share information that could be used to access your financial accounts. If another user asks you for money, report it to us immediately.</p><p><br></p><p>For tips on avoiding romance scams, check out some advice from the U.S Federal Trade Commission on the FTC website.</p><p><br></p><p>Protect Your Personal Information</p><p><br></p><p>Never share personal information, such as your social security number, home or work address, or details about your daily routine (e.g., that you go to a certain gym every Monday) with people you don’t know. If you are a parent, limit the information that you share about your children on your profile and in early communications. Avoid sharing details such as your children’s names, where they go to school, or their ages or genders.</p><p><br></p><p>Stay on the Platform</p><p><br></p><p>Keep conversations on the GoMeet platform while you’re getting to know someone. Because exchanges on GoMeet are subject to our Safe Message Filters, users with bad intentions often try to move the conversation to text, messaging apps, email, or phone right away.</p><p><br></p><p>Be Wary of Long Distance and Overseas Relationships</p><p><br></p><p>Watch out for scammers who claim to be from your country but stuck somewhere else, especially if they ask for financial help to return home. Be wary of anyone who will not meet in person or talk on a phone/video call—they may not be who they say they are. If someone is avoiding your questions or pushing for a serious relationship without meeting or getting to know you first — that’s a red flag.</p><p><br></p><p>Report All Suspicious and Offensive Behavior</p><p><br></p><p>You know when someone’s crossed the line and when they do, we want to know about it. Block and report anyone that violates our terms. Here are some examples of violations:</p><p><br></p><p>Requests for money or donations</p><p><br></p><p>Underage users</p><p><br></p><p>Harassment, threats, and offensive messages</p><p><br></p><p>Inappropriate or harmful behavior during or after meeting in person</p><p><br></p><p>Fraudulent profiles</p><p><br></p><p>Spam or solicitation including links to commercial websites or attempts to sell products or services</p><p><br></p><p>You can report any concerns about suspicious behavior from any profile page or messaging window. For more information, check out our Community Guidelines.</p><p><br></p><p>Protect Your Account</p><p><br></p><p>Be sure to pick a strong password, and always be careful when logging into your account from a public or shared computer. GoMeet will never send you an email asking for your username and password information — if you receive an email asking for account information, report it immediately.</p>');

